import Social_inline from "./Social_inline";
import logo from "../assets/Got7_2022_logo.png";

function Discography(params) {
  return (
    <>
      <style>
        {`
          html, body {
            background-color: #F3F6F4;
          }
        `}
      </style>
      <div className="app">
        <Social_inline />
        <div
          className="head-logo"
          style={{
            display: "flex",
            height: "60px",
            justifyContent: "center",
            position: "relative",
            marginTop: "-50px",
          }}
        >
          <img src={logo}></img>
        </div>
        <div className="notice-heading">
          <h1
            style={{
              textAlign: "center",
              marginTop: "60px",
              color: "#3C8350",
              fontSize: "38px",
            }}
          >
            CONTACT
          </h1>
          <div className="disc-body"></div>
        </div>
      </div>
    </>
  );
}
export default Discography;
